import React, { useState } from "react";
import './Item.css';
import 'animate.css'

function Item(props){
    
    return(
        <div className="title animate__animated animate__zoomIn">
        <a className="" href={props.link}>{props.title}</a>
        </div>
    )
}

export default Item;
